import React, { useEffect, useState } from 'react';
import Axios from 'axios';

function ToDoList() {
  const [tasks, setTasks] = useState([]);

  const fetchTasks = async () => {
    try {
      const { data } = await Axios.get('http://localhost:8000/api/v1/task');
      const arrayOfTask = [data];
      setTasks(data.data[0]); // Assuming your API returns an array of tasks

      console.log(data.data[0,1].task)
    } catch (error) {
      console.error('Error fetching tasks:', error);
    }
  };

  useEffect(() => {
    fetchTasks();
  }, []);
// console.log("tasc",tasks.data[0].task)
  return (
    <div>
      <h2>To-Do List</h2>
        <p key={tasks.id}>{tasks.task}</p>
    </div>
  );
}

export default ToDoList;
